import { StyleSheet, Platform } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 2,
      alignItems: 'flex-start',
      // justifyContent:'center',
      backgroundColor: '#610000',
      
    },
    archive:{
      flexDirection:'row',
      justifyContent:'space-evenly'

    },
    largeHeading: {
        fontSize: 30,
        fontStyle: 'bold',
        paddingTop:'15%',
        paddingLeft:'40%',
        paddingRight:'40%',
        textAlign:'center',
        ...Platform.select({
          ios: {
            color: 'yellow',
          },
          default: {
            color: 'white'
          }
        }),
    },
    listContainer: {
        flexGrow: 0,
        flexShrink: 0
    },
    inputs:{
      backgroundColor:'rgba(255,255,255,0.25)',
      color:'white',
      fontSize:12,
      marginLeft:'40%',
      borderRadius:'20px',
      padding:'.5%',
      marginTop:'1%',
      textAlign:'center'
    },
    subtitle:{
      color:'white',
      fontSize:16,
      textAlign:'center',
      paddingLeft:'33%',
      paddingRight:'33%'
    },
    displayOS:{
      paddingLeft:'45%',
      paddingRight:'45%',
      ...Platform.select({
        ios:{
          color:'white',
        },
          default:{
            color:'yellow'
          }
        }),
      },
      button:{
        paddingTop:'2%',
        paddingLeft:'42%',
      },
      submit:{
        paddingTop:'2%',
        paddingLeft:'48%',
      },
      addMovie:{
        marginRight:'60%',
        marginLeft:'150%'
      },
      displayMovies:{
        // marginLeft:'65%',

      },
      titles:{
        fontSize:18,
        color:'white'
      }
    },
    
);

  export default styles;
